import React from "react";
const Pokem = (()=>{
    return (
        <>
            <h1>This is Pokemon App</h1>
            <select>
                <option value = "1">1</option>
                <option value = "25">25</option>
                <option value = "3">3</option>
                <option value = "4">4</option>
            </select>
        </>
    )
})
export default Pokem
